    true,nt"url": null,nt"notes": "ML2SO2_NRT is the EOS Aura Microwave Limb
    Sounder (MLS) Near-Real-Time (NRT) product for sulfur dioxide (SO2). This product
    contains daily SO2 profiles taken from the 240 GHz band. The most recent 7 days
    of data are available. Spatial coverage is near-global (-82 deg. to +82 deg. latitude),
    with each profile spaced 1.5 deg. or ~165 km along the orbit track (roughly 15 orbits
    per day). The recommended useful vertical range of NRT Sulfur Dioxide profiles is
    215 - 10.0 hPa. There are about 96 NRT files per day containing roughly 15 minutes
    or less of data each.nnBefore using these data, please download both the MLS version
    3.4 NRT User Guide which describes the NRT algorithm and data quality, as well as
    the MLS Level-2 Data Quality Document for Standard Products which describes the
    caveats for using MLS SO2 data. MLS documentation can be found at http://disc.sci.gsfc.nasa.gov/Aura/additional/documentation/.n
               nUsers are encouraged to register with the MLS team at http://mls.jpl.nasa.gov/
    to obtain updates and information about this product from the MLS team.",nt"license_title":
